SELECT flight_1.flight_id, flight_1.airline_code, flight_1.departure_time, flight_1.arrival_time FROM flight flight_1 , airport_service airport_service_1 ON flight_1.from_airport = airport_service_1.airport_code , airport airport_service_2 ON flight_1.to_airport = airport_service_2.airport_code WHERE airport_service_1.city_code = 'HOUSTON' AND airport_service_2.city_code = 'MILWAUKEE' AND flight_1.day = 'friday'
SELECT DISTINCT ground_service_1.ground_fare FROM ground_service ground_service_1 , airport airport_1 , airport_service airport_service_1 , city city_1 WHERE ground_service_1.airport_code = airport_1.airport_code AND airport_1.airport_code = airport_service_1.airport_code AND airport_service_1.city_code = city_1.city_code AND city_1.city_name = 'ATLANTTA'
SELECT DISTINCT flight_1.flight_id FROM flight flight_1 , airport_service airport_service_1 , city city_1 , airport_service airport_service_2 , city city_2 WHERE flight_1.from_airport = airport_service_1.airport_code AND airport_service_1.city_code = city_1.city_code AND city_1.city_name = 'DENVER' AND flight_1.to_airport = airport_service_2.airport_code AND airport_service_2.city_code = city_2.city_code AND city_2.city_name = 'PITTSBURGH'
SELECT DISTINCT flight_1.flight_id FROM flight flight_1 , airport_service airport_service_1 ON flight_1.from_airport = airport_service_1.airport_code , city city_1 ON airport_service_1.city_code = city_1.city_code , airport_service airport_service_2 ON flight_1.to_airport = airport_service_2.airport_code , city city_2 ON airport_service_2.city_code = city_2.city_code WHERE flight_1.departure_time BETWEEN 1800 AND 2200
SELECT flight_id, from_city, to_city, fare FROM flight WHERE to_city = 'MINneapolis'
SELECT DISTINCT ground_service_1.transport_type FROM ground_service ground_service_1 , airport airport_1 ON ground_service_1.airport_code = airport_1.airport_code , city city_1 ON airport_1.city_code = city_1.city_code WHERE city_1.city_name = 'PHOENIX'
SELECT DISTINCT flight_1.flight_id FROM flight flight_1 WHERE flight_1.departure_time BETWEEN 0 AND 1200 AND flight_1.from_airport = 'SJC' AND flight_1.to_airport = 'NSM' AND flight_1.flight_day = '2023-06-03'
SELECT DISTINCT flight_1.flight_id FROM flight flight_1 , airport_service airport_service_1 ON flight_1.from_airport = airport_service_1.airport_code , city city_1 ON airport_service_1.city_code = city_1.city_code , airport airport_service_2 ON flight_1.to_airport = airport_service_2.airport_code , city city_2 ON airport_service_2.city_code = city_2.city_code WHERE flight_1.departure_date = '2023-10-27' AND city_1.city_name = 'Dallas' AND city_2.city_name = 'San Francisco'
SELECT DISTINCT flight_1.flight_id FROM flight flight_1 , flight_fare flight_fare_1 ON flight_1.flight_id = flight_fare_1.flight_id , fare fare_1 ON flight_fare_1.fare_id = fare_1.fare_id , airport_service airport_service_1 ON fare_1.one_direction_cost = ( SELECT MIN( fare_1.one_direction_cost ) FROM fare fare_1 , flight_fare flight_fare_1 ON fare_1.fare_id = flight_fare_1.fare_id , flight flight_1 ON flight_fare_1.flight_id = flight_1.flight_id , airport_service airport_service_1 ON flight_1.from_airport = airport_service_1.airport_code AND airport_service_1.city_code = city_1.city_code AND city_1.city_name = 'DENVER' ) AND fare_1.round_trip_required = 'NO' AND flight_1.from_airport = airport_service_1.airport_code AND airport_service_1.city_code = city_1.city_code AND city_1.city_name = 'PITTSBURGH'
SELECT DISTINCT flight_1.flight_id FROM flight flight_1 , airport_service airport_service_1 ON flight_1.from_airport = airport_service_1.airport_code , city city_1 ON airport_service_1.city_code = city_1.city_code , airport airport_service_2 ON flight_1.to_airport = airport_service_2.airport_code , city city_2 ON airport_service_2.city_code = city_2.city_code WHERE city_1.city_name = 'SAN DIEGO' AND city_2.city_name = 'DULLES' AND flight_1.boeing_767 = 1
SELECT DISTINCT airline_1.airline_code FROM airline airline_1 WHERE EXISTS ( SELECT * FROM flight flight_1 , airport_service airport_service_1 ON flight_1.to_airport = airport_service_1.airport_code , city city_1 ON airport_service_1.city_code = city_1.city_code WHERE city_1.city_name = 'BOSTON' AND flight_1.to_airport = 'DCA' )
SELECT DISTINCT flight_id FROM flight flight , flight_stop flight_stop ON flight.flight_id = flight_stop.flight_id , airport_service airport_service ON flight_stop.stop_airport = airport_service.airport_code , city city ON airport_service.city_code = city.city_code WHERE city.city_name = 'Dallas' AND flight_stop.arrival_time < 1200
